import React, { useState } from 'react';
import API from '../services/api';
import { useNavigate } from 'react-router-dom';

export default function Register(){
  const [name,setName]=useState(''); const [email,setEmail]=useState(''); const [password,setPassword]=useState('');
  const [role,setRole]=useState('STUDENT');
  const nav = useNavigate();

  async function submit(e){
    e.preventDefault();
    try{
      await API.post('/auth/register', { name, email, password, role });
      alert('Registered. Please login.');
      nav('/login');
    }catch(err){ alert(err.response?.data?.error || err.message); }
  }

  return (
    <div className="col-md-6 offset-md-3">
      <h3>Register</h3>
      <form onSubmit={submit}>
        <div className="mb-2"><label>Name</label><input className="form-control" value={name} onChange={e=>setName(e.target.value)} /></div>
        <div className="mb-2"><label>Email</label><input className="form-control" value={email} onChange={e=>setEmail(e.target.value)} /></div>
        <div className="mb-2"><label>Password</label><input type="password" className="form-control" value={password} onChange={e=>setPassword(e.target.value)} /></div>
        <div className="mb-2"><label>Role</label>
          <select className="form-select" value={role} onChange={e=>setRole(e.target.value)}>
            <option value="STUDENT">Student</option>
            <option value="LECTURER">Lecturer</option>
            <option value="PRL">Principal Lecturer</option>
            <option value="PL">Program Leader</option>
          </select>
        </div>
        <button className="btn btn-primary">Register</button>
      </form>
    </div>
  );
}
